  \"Environmental Assessment for the Kenai National Wildlife Refuge Furbearer Management
  Plan\",\n\t\"tracking_summary\": {\n\t\t\"total\": 13,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2016-07-27T22:20:49.348102\",\n\t\"name\":
  \"environmental-assessment-for-the-kenai-national-wildlife-refuge-furbearer-management-plan\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The management of furbearers on the Kenai
  Refuge is a controversial issue. Trapping has occurred on the Kenai Refuge since
  before it was established as a refuge. Local residents, trappers, refuge users,
  conservation groups, and concerned citizens have varying, often conflicting, views
  on trapping in National Wildlife Refuges. Questions are raised regarding season
  lengths, humaneness of trapping, the capture of non-target species, conflicts between
  trappers and other refuge users, the status of some furbearer populations, and the
  level of harvestable surpluses, among other issues. The preferred alternative sets
  no regulations limiting the number of trappers, traps, or sets on the refuge for
  wolves; a bag limit of one wolverine per hunter per season; no bag limit on marten;
  one red fox per trapper per year; a bag limit of 20 on beaver; and no bag limit
  on coyote. Trap checks would be required every four days under this alternative.
  The Finding of No Significant Impact (FONSI) and the Environmental Action Memorandum
  are included with this document.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
